import React, { Component } from "react";
import Button from "./button";

export default class navBar extends Component {
  render() {
      function ActionLink(){
          function loadMain(e){
            e.preventDefault();
            console.log("You clicked for the Main Page.")
          }
          function loadCustom(e){
            e.preventDefault();
            console.log("You clicked for the Custom Page.")
          }
          function loadAbout(e){
            e.preventDefault();
            console.log("You clicked for the About Page.")
          }
      }
    return (
      <nav className="navbar fixed-top navbar-dark bg-dark">
        <div className="container-fluid justify-content-center">
          <ul className="nav list-inline">
            <li className="btn rounded list-inline-item">
              <a href="#" style={{ color: "linen" }} onClick={this.ActionLink.loadMain}>
                Official Fantasy
              </a>
            </li>
            <li className="btn rounded list-inline-item" onClick={this.ActionLink.loadCustom}>
              <a href="#" style={{ color: "linen" }}>
                Custom Fantasy
              </a>
            </li>
            <li className="btn rounded list-inline-item" onClick={this.ActionLink.loadAbout}>
              <a href="#" style={{ color: "linen" }}>
                About
              </a>
            </li>
          </ul>
        </div>
      </nav>
    );
  }
}
